  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0100114 includes chemical,
  discrete bottle, physical and time series profile data collected from ARNI FRIDRIKSSON
  and BJARNI SAEMUNDSSON in the Irminger Sea and North Atlantic Ocean from 1991-08-08
  to 2006-02-02 and retrieved during cruise CARINA_Irminger_Sea Time Series. These
  data include CARBON DIOXIDE - PARTIAL PRESSURE (pCO2), DISSOLVED INORGANIC CARBON,
  DISSOLVED OXYGEN, NITRATE, PHOSPHATE, SALINITY, SILICATE and TEMPERATURE. The instruments
  used to collect these data include bottle. These data were collected by J. Olafsson
  of ICELANDIC MARINE RESEARCH INSTITUTE as part of the CARINA_Irminger_Sea Time Series
  data set.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
